    "2015-09-26T21:11:38.274650",nt"name": "noaa-office-for-coastal-management-coastal-inundation-digital-elevation-model-jacksonville-wfo-",nt"isopen":
    false,nt"url": null,nt"notes": "This digital elevation model (DEM) is a
    part of a series of DEMs produced for the National Oceanic and Atmospheric Administration
    Office for Coastal Management's Sea Level Rise and Coastal Flooding Impacts Viewer.
    The DEM includes best available lidar data known to exist at the time of DEM creation
    that meets project specifications for those counties in the state of Georgia that
    fall within the boundary of the Jacksonville, FL Weather Forecast Office (WFO),
    as defined by the NOAA National Weather Service. The DEM is derived from LiDAR data
    collected in 2010 under a multi-agency partnership between the Coastal Georgia Regional
    Development Center, USGS, FEMA, NOAA and local county governments. Although the
    entire project extent extends beyond the boundaries of this DEM, only data in Camden
    County, as well as portions of Charlton, Brantley, and Wayne Counties was used in
    DEM creation. Hydrographic breaklines used in the creation of the DEM were obtained
    from the Coastal Regional Georgia Development Center. The DEMs are hydro flattened
    such that water elevations are less than or equal to 0 meters. The DEM is referenced
    vertically to the North American Vertical Datum of 1988 (NAVD88) with vertical units
    of meters and horizontally to the North American Datum of 1983 (NAD83). The resolution
    of the DEM is approximately 5 meters. This DEM does not include licensed data within
    the boundary of the WFO that is unavailable for distribution to the general public.
    As such, the extent of this DEM is different than that of the DEM used by the NOAA
    Office for Coastal Management in creating the inundation data seen in the Sea Level
    Rise and Coastal Impacts Viewer (http://www.coast.noaa.gov/slr/viewer/).",nt"license_title":
